import React, { useState, useEffect } from "react";
import API from "../utils/API";

function Transactions () {
    const [transactions, setTransactions] = useState([])


    return (
        <table>
            <thead>
                <tr>
                    <th>Location</th>
                    <th>Amount</th>
                    <th>Date</th>
                    <th>Status</th>
                </tr>
            </thead>

            <tbody>
                {transactions.map(item =>
                <tr key={item.id}> 
                    <td>{item.location}</td>
                    <td>{item.bill}</td>
                    <td>{item.date}</td>
                    <td>{item.status}</td>
                </tr>
                )}
            </tbody>
        </table>
    );
}

    export default TableBody
